import React from "react"
import "./style.module.scss"
import LinkNavigation from "../../atoms/LinkNatigation"
import Image from "../../atoms/Image"

const NavBar = () => {
    return (
        <nav>
            <LinkNavigation href="www.google.com.br" text="Google" />
            <Image src="logo192.png" alt="author" width="15px" />
        </nav>
    )
}

export default NavBar
